(782, 'Bundle.properties', 'oauth2.callback.message', '<strong>Authentication Error</strong> - Dataverse could not authenticate your ORCID login. Please make sure you authorize your ORCID account to connect with Dataverse. For more details about the information being requested, see the <a href="{0}/{1}/user/account.html#orcid-log-in" title="ORCID Log In - Dataverse User Guide" target="_blank">User Guide</a>.', '<strong>Erro de autenticação</strong> - O Dataverse não pôde autenticar seu login ORCID. Por favor, certifique-se de autorizar sua conta ORCID para se conectar com o Dataverse. Para obter mais detalhes sobre as informações solicitadas, consulte o <a href="{0}/{1}/user/account.html#orcid-log-in" title="Guia do Usuário do ORCID Log-In - Dataverse" target="_blank">Guia do Usuário</a>.', '2019-08-07 12:57:16', 0),
