(800, 'Bundle.properties', 'dashboard.card.metadataexport.message', 'Dataset metadata export is only available through the {0} API. Learn more in the {0} {1}API Guide{2}.', 'A exportação de metadados do conjunto de dados está disponível somente por meio da API {0}. Saiba mais no {0} {1} Guia da API {2}.', '2019-08-07 12:57:16', 0),
(801, 'Bundle.properties', 'harvestclients.title', 'Manage Harvesting Clients', 'Gerenciar clientes de colheita', '2019-08-07 12:57:16', 0),
(802, 'Bundle.properties', 'harvestclients.toptip', 'Harvesting can be scheduled to run at a specific time or on demand. Harvesting can be initiated here or via the REST API.', 'A colheita pode ser programada para ser executada em um horário específico ou sob demanda. A colheita pode ser iniciada aqui ou por meio da API REST.', '2019-08-07 12:57:16', 0),
(803, 'Bundle.properties', 'harvestclients.noClients.label', 'No clients are configured.', 'Nenhum cliente está configurado.', '2019-08-07 12:57:16', 0),
(804, 'Bundle.properties', 'harvestclients.noClients.why.header', 'What is Harvesting?', 'O que é a colheita?', '2019-08-07 12:57:16', 0),
(805, 'Bundle.properties', 'harvestclients.noClients.why.reason1', 'Harvesting is a process of exchanging metadata with other repositories. As a harvesting <b><i>client</i></b>, your Dataverse gathers metadata records from remote sources. These can be other Dataverse instances, or other archives that support OAI-PMH, the standard harvesting protocol.', 'A colheita é um processo de troca de metadados com outros repositórios. Como <b><i>cliente</i></b> de coleta, seu Dataverse reúne registros de metadados de origens remotas. Essas podem ser outras instâncias do Dataverse ou outros arquivos que suportam o OAI-PMH, o protocolo de coleta padrão.', '2019-08-07 12:57:16', 0),
(806, 'Bundle.properties', 'harvestclients.noClients.why.reason2', 'Harvested metadata records are searchable by users. Clicking on a harvested dataset in the search results takes the user to the original repository. Harvested datasets cannot be edited in your Dataverse installation.', 'Os registros de metadados coletados são pesquisáveis pelos usuários. Clicar em um conjunto de dados colhido nos resultados da pesquisa leva o usuário ao repositório original. Conjuntos de dados coletados não podem ser editados em sua instalação do Dataverse.', '2019-08-07 12:57:16', 0),
(807, 'Bundle.properties', 'harvestclients.noClients.how.header', 'How To Use Harvesting', 'Como usar a colheita', '2019-08-07 12:57:16', 0),
(808, 'Bundle.properties', 'harvestclients.noClients.how.tip1', 'To harvest metadata, a <i>Harvesting Client</i> is created and configured for each remote repository. Note that when creating a client you will need to select an existing local dataverse to host harvested datasets.', 'Para coletar metadados, um <i>cliente de coleta</i> é criado e configurado para cada repositório remoto. Observe que ao criar um cliente, você precisará selecionar um dataverse local existente para hospedar conjuntos de dados coletados.', '2019-08-07 12:57:16', 0),
(809, 'Bundle.properties', 'harvestclients.noClients.how.tip2', 'Harvested records can be kept in sync with the original repository through scheduled incremental updates, for example, daily or weekly. Alternatively, harvests can be run on demand, from this page or via the REST API.', 'Registros coletados podem ser mantidos em sincronia com o repositório original através de atualizações incrementais agendadas, por exemplo, diariamente ou semanalmente. Alternativamente, as colheitas podem ser executadas sob demanda, a partir desta página ou por meio da API REST.', '2019-08-07 12:57:16', 0),
(810, 'Bundle.properties', 'harvestclients.noClients.getStarted', 'To get started, click on the Add Client button above. To learn more about Harvesting, visit the <a href="{0}/{1}/user/index.html#index" title="Harvesting - Dataverse User Guide" target="_blank">Harvesting</a> section of the User Guide.', 'Para começar, clique no botão Adicionar Cliente acima. Para saber mais sobre a colheita, visite a seção <a href="{0}/{1}/user/index.html#index" title="Harvesting-Dataverse User Guide" target="_blank">Colheita</a> do Guia do Usuário.', '2019-08-07 12:57:16', 0),
(811, 'Bundle.properties', 'harvestclients.btn.add', 'Add Client', 'Adicionar cliente', '2019-08-07 12:57:16', 0),
