(814, 'Bundle.properties', 'harvestclients.tab.header.lastrun', 'Last Run', 'Última execução', '2019-08-07 12:57:16', 0),
(815, 'Bundle.properties', 'harvestclients.tab.header.lastresults', 'Last Results', 'Últimos resultados', '2019-08-07 12:57:16', 0),
(816, 'Bundle.properties', 'harvestclients.tab.header.action', 'Actions', 'Ações', '2019-08-07 12:57:16', 0),
(817, 'Bundle.properties', 'harvestclients.tab.header.action.btn.run', 'Run Harvesting', 'Executar a colheita', '2019-08-07 12:57:16', 0),
(818, 'Bundle.properties', 'harvestclients.tab.header.action.btn.edit', 'Edit', 'Editar', '2019-08-07 12:57:16', 0),
(819, 'Bundle.properties', 'harvestclients.tab.header.action.btn.delete', 'Delete', 'Excluir', '2019-08-07 12:57:16', 0),
(820, 'Bundle.properties', 'harvestclients.tab.header.action.btn.delete.dialog.header', 'Delete Harvesting Client', 'Excluir cliente de colheita', '2019-08-07 12:57:16', 0),
(821, 'Bundle.properties', 'harvestclients.tab.header.action.btn.delete.dialog.warning', 'Are you sure you want to delete the harvesting client "{0}"? Deleting the client will delete all datasets harvested from this remote server.', 'Tem certeza de que deseja excluir o cliente de colheita "{0}"? A exclusão do cliente excluirá todos os conjuntos de dados coletados deste servidor remoto.', '2019-08-07 12:57:16', 0),
(822, 'Bundle.properties', 'harvestclients.tab.header.action.btn.delete.dialog.tip', 'Note, this action may take a while to process, depending on the number of harvested datasets.', 'Observe que esta ação pode demorar um pouco para processar, dependendo do número de conjuntos de dados coletados.', '2019-08-07 12:57:16', 0),
(823, 'Bundle.properties', 'harvestclients.tab.header.action.delete.infomessage', 'Harvesting client is being deleted. Note, that this may take a while, depending on the amount of harvested content.', 'O cliente de colheita está sendo excluído. Observe que isso pode demorar um pouco, dependendo da quantidade de conteúdo coletado.', '2019-08-07 12:57:16', 0),
(824, 'Bundle.properties', 'harvestclients.actions.runharvest.success', 'Successfully started an asynchronous harvest for client "{0}" . Please reload the page to check on the harvest results).', 'Iniciou com êxito uma colheita assíncrona para o cliente "{0}". Atualize a página para verificar os resultados da colheita).', '2019-08-07 12:57:16', 0),
