(827, 'Bundle.properties', 'harvestclients.newClientDialog.help', 'Configure a client to harvest content from a remote server.', 'Configure um cliente para coletar conteúdo de um servidor remoto.', '2019-08-07 12:57:16', 0),
(828, 'Bundle.properties', 'harvestclients.newClientDialog.nickname', 'Nickname', 'Apelido', '2019-08-07 12:57:16', 0),
