(838, 'Bundle.properties', 'harvestclients.newClientDialog.url.tip', 'URL of a harvesting resource.', 'URL de um recurso de colheita.', '2019-08-07 12:57:16', 0),
(839, 'Bundle.properties', 'harvestclients.newClientDialog.url.watermark', 'Remote harvesting server, http://...', 'Servidor de colheita remota, http://...', '2019-08-07 12:57:16', 0),
(840, 'Bundle.properties', 'harvestclients.newClientDialog.url.helptext.notvalidated', 'URL of a harvesting resource. Once you click ´Next´, we will try to establish a connection to the server in order to verify that it is working, and to obtain extra information about its capabilities.', 'URL de um recurso de colheita. Depois de clicar em "Avançar", tentaremos estabelecer uma conexão com o servidor para verificar se está funcionando e obter informações extras sobre seus recursos.', '2019-08-07 12:57:16', 0),
(841, 'Bundle.properties', 'harvestclients.newClientDialog.url.required', 'A valid harvesting server address is required.', 'É necessário um endereço de servidor de colheita válido.', '2019-08-07 12:57:16', 0),
