(895, 'Bundle.properties', 'harvestserver.noSets.why.header', 'What is a Harvesting Server?', 'O que é um servidor de colheita?', '2019-08-07 12:57:16', 0),
(896, 'Bundle.properties', 'harvestserver.noSets.why.reason1', 'Harvesting is a process of exchanging metadata with other repositories. As a harvesting <b><i>server</i></b>, your Dataverse can make some of the local dataset metadata available to remote harvesting clients. These can be other Dataverse instances, or any other clients that support OAI-PMH harvesting protocol.', 'A colheita é um processo de troca de metadados com outros repositórios. Como um <b><i>servidor</b></i> de coleta, seu Dataverse pode disponibilizar alguns dos metadados do conjunto de dados local para clientes de coleta remota. Estas podem ser outras instâncias do Dataverse, ou quaisquer outros clientes que suportem o protocolo de extração OAI-PMH.', '2019-08-07 12:57:16', 0),
(897, 'Bundle.properties', 'harvestserver.noSets.why.reason2', 'Only the published, unrestricted datasets in your Dataverse can be harvested. Remote clients normally keep their records in sync through scheduled incremental updates, daily or weekly, thus minimizing the load on your server. Note that it is only the metadata that are harvested. Remote harvesters will generally not attempt to download the data files themselves.', 'Somente os conjuntos de dados irrestritos publicados em seu Dataverse podem ser coletados. Os clientes remotos normalmente mantêm seus registros sincronizados por meio de atualizações incrementais programadas, diárias ou semanais, minimizando assim a carga em seu servidor. Observe que são apenas os metadados que são coletados. Os colhedores remotos geralmente não tentam baixar os arquivos de dados.', '2019-08-07 12:57:16', 0),
(898, 'Bundle.properties', 'harvestserver.noSets.how.header', 'How to run a Harvesting Server?', 'Como executar um servidor de colheita?', '2019-08-07 12:57:16', 0),
(899, 'Bundle.properties', 'harvestserver.noSets.how.tip1', 'Harvesting server can be enabled or disabled on this page.', 'O servidor de coleta pode ser ativado ou desativado nesta página.', '2019-08-07 12:57:16', 0),
(900, 'Bundle.properties', 'harvestserver.noSets.how.tip2', 'Once the service is enabled, you can define collections of local datasets that will be available to remote harvesters as <i>OAI Sets</i>. Sets are defined by search queries (for example, authorName:king., or parentId:1234 - to select all the datasets that belong to the dataverse specified., or dsPersistentId:"doi:1234/" to select all the datasets with the persistent identifier authority specified). Consult the Search API section of the Dataverse User Guide for more information on the search queries.', 'Uma vez que o serviço esteja ativado, você pode definir coleções de conjuntos de dados locais que estarão disponíveis para colhedores remotos como <i>conjuntos OAI</i>. Os conjuntos são definidos por consultas de pesquisa (por exemplo, autorName: king. ou parentId:1234 - para selecionar todos os conjuntos de dados que pertencem ao dataverse especificado. ou dsPersistentId: "doi:1234/" para selecionar todos os conjuntos de dados com o persistente autoridade identificadora especificada). Consulte a seção API de pesquisa do Guia do usuário do Dataverse para obter mais informações sobre as consultas de pesquisa.', '2019-08-07 12:57:16', 0),
(901, 'Bundle.properties', 'harvestserver.noSets.getStarted', 'To get started, enable the OAI server and click on the Add Set button. To learn more about Harvesting, visit the <a href="{0}/{1}/user/index.html#index" title="Harvesting - Dataverse User Guide" target="_blank">Harvesting</a> section of the User Guide.', 'Para começar, ative o servidor OAI e clique no botão Adicionar conjunto. Para saber mais sobre a colheita, visite a seção <a href="{0}/{1}/user/index.html#index" title="Harvesting-Dataverse User Guide" target="_blank">Colheita</a> do Guia do Usuário.', '2019-08-07 12:57:16', 0),
