(1791, 'Bundle.properties', 'file.rsyncUpload.step3', 'Open a terminal window in the same directory you saved the script and run this command: <code>bash ./{0}</code>', 'Abra uma janela de terminal no mesmo diretório que você salvou o script e execute este comando: <code>bash ./{0}</code>', '2019-08-07 12:57:17', 0),
(1792, 'Bundle.properties', 'file.rsyncUpload.step4', 'Follow the instructions in the script. It will ask for a full path (beginning with "/") to the directory containing your data. Note: this script will expire after 7 days.', 'Siga as instruções no script. Ele pedirá um caminho completo (começando com "/") para o diretório que contém seus dados. Nota: este script irá expirar após 7 dias.', '2019-08-07 12:57:17', 0),
(1793, 'Bundle.properties', 'file.rsyncUpload.inProgressMessage.summary', 'File Upload in Progress', 'Upload de arquivo em andamento', '2019-08-07 12:57:17', 0),
(1794, 'Bundle.properties', 'file.rsyncUpload.inProgressMessage.details', 'This dataset is locked while the data files are being transferred and verified.', 'Este conjunto de dados é bloqueado enquanto os arquivos de dados estão sendo transferidos e verificados.', '2019-08-07 12:57:17', 0),
(1795, 'Bundle.properties', 'file.rsyncUpload.httpUploadDisabledDueToRsyncFileExisting', 'HTTP upload is disabled for this dataset because you have already uploaded files via rsync. If you would like to switch to HTTP upload, please contact {0}.', 'O upload de HTTP está desativado para este conjunto de dados porque você já fez upload de arquivos via rsync. Se você quiser mudar para o upload HTTP, entre em contato com {0}.', '2019-08-07 12:57:17', 0),
(1796, 'Bundle.properties', 'file.rsyncUpload.httpUploadDisabledDueToRsyncFileExistingAndPublished', 'HTTP upload is disabled for this dataset because you have already uploaded files via rsync and published the dataset.', 'O upload de HTTP está desativado para este conjunto de dados porque você já fez upload de arquivos via rsync e publicou o conjunto de dados.', '2019-08-07 12:57:17', 0),
(1797, 'Bundle.properties', 'file.rsyncUpload.rsyncUploadDisabledDueFileUploadedViaHttp', 'Upload with rsync + SSH is disabled for this dataset because you have already uploaded files via HTTP. If you would like to switch to rsync upload, then you must first remove all uploaded files from this dataset. Once this dataset is published, the chosen upload method is permanently locked in.', 'O upload com rsync + SSH está desativado para este conjunto de dados porque você já fez upload de arquivos via HTTP. Se você quiser mudar para o upload do rsync, primeiro remova todos os arquivos enviados deste conjunto de dados. Depois que esse conjunto de dados for publicado, o método de upload escolhido será permanentemente bloqueado.', '2019-08-07 12:57:17', 0),
(1798, 'Bundle.properties', 'file.rsyncUpload.rsyncUploadDisabledDueFileUploadedViaHttpAndPublished', 'Upload with rsync + SSH is disabled for this dataset because you have already uploaded files via HTTP and published the dataset.', 'O upload com rsync + SSH está desativado para este conjunto de dados porque você já fez o upload de arquivos via HTTP e publicou o conjunto de dados.', '2019-08-07 12:57:17', 0),
