(1862, 'Bundle.properties', 'file.dataFilesTab.terms.list.termsOfUse.waiver.title', 'The waiver informs data downloaders how they can use this dataset.', 'O termo de uso informa aos usuários como eles podem usar esse conjunto de dados, conforme a licença utilizada.', '2019-08-07 12:57:17', 0),
(1863, 'Bundle.properties', 'file.dataFilesTab.terms.list.termsOfUse.waiver.txt', 'CC0 - "Public Domain Dedication"', 'CC0 - "Dedicação de Domínio Público"', '2019-08-07 12:57:17', 0),
(1864, 'Bundle.properties', 'file.dataFilesTab.terms.list.termsOfUse.waiver.description', 'Datasets will default to a <a href="https://creativecommons.org/publicdomain/zero/1.0/" title="Public Domain Dedication - Creative Commons" target="_blank">CC0 public domain dedication </a>. CC0 facilitates reuse and extensibility of research data. Our <a href="https://dataverse.org/best-practices/dataverse-community-norms" title="Dataverse Community Norms - Dataverse.org" target="_blank">Community Norms</a> as well as good scientific practices expect that proper credit is given via citation. If you are unable to give datasets a CC0 waiver you may enter custom Terms of Use for datasets.', 'Os conjuntos de dados terão como padrão uma dedicação <a href="https://creativecommons.org/publicdomain/zero/1.0/" title="Dedicação de domínio público-Creative Commons" target="_blank">CC0 domínio público</a>. CC0 facilita a reutilização e extensibilidade de dados de pesquisa. Nossas <a href="https://dataverse.org/best-practices/dataverse-community-norms" title="Dataverse Community Norms - Dataverse.org" target="_blank">Normas Comunitárias</a>, bem como Boas práticas científicas esperam que crédito apropriado seja dado por meio de citação. Se você não puder fornecer conjuntos de dados com uma isenção CC0, poderá inserir Termos de Uso personalizados para conjuntos de dados.', '2019-08-07 12:57:17', 0),
(1865, 'Bundle.properties', 'file.dataFilesTab.terms.list.termsOfUse.no.waiver.txt', 'No waiver has been selected for this dataset.', 'Nenhuma renúncia foi selecionada para este conjunto de dados.', '2019-08-07 12:57:17', 0),
(1866, 'Bundle.properties', 'file.dataFilesTab.terms.list.termsOfUse.waiver.txt.description', 'Our <a href="https://dataverse.org/best-practices/dataverse-community-norms" title="Dataverse Community Norms - Dataverse.org" target="_blank">Community Norms</a> as well as good scientific practices expect that proper credit is given via citation. Please use the data citation above, generated by the Dataverse.', 'Nossas normas <a href="https://dataverse.org/best-practices/dataverse-community-norms" title="Dataverse Community Norms-Dataverse.org" target="_blank">Community</a> além de boas práticas científicas, espera-se que seja dado crédito adequado por meio de citação. Por favor, use a citação de dados acima, gerada pelo Dataverse.', '2019-08-07 12:57:17', 0),
(1867, 'Bundle.properties', 'file.dataFilesTab.terms.list.termsOfUse.waiver.select.CCO', 'Yes, apply CC0 - "Public Domain Dedication"', 'Sim, aplique CC0 - "Dedicação ao Domínio Público"', '2019-08-07 12:57:17', 0),
(1868, 'Bundle.properties', 'file.dataFilesTab.terms.list.termsOfUse.waiver.select.notCCO', 'No, do not apply CC0 - "Public Domain Dedication"', 'Não, não se aplica CC0 - "Dedicação de Domínio Público"', '2019-08-07 12:57:17', 0),
(1869, 'Bundle.properties', 'file.dataFilesTab.terms.list.termsOfUse.waiver.select.tip', 'This is what end users will see displayed on this dataset', 'Isto é o que os usuários finais verão exibidos neste conjunto de dados.', '2019-08-07 12:57:17', 0),
(1870, 'Bundle.properties', 'file.dataFilesTab.terms.list.termsOfUse.termsOfUse', 'Terms of Use', 'Termos de Uso', '2019-08-07 12:57:17', 0),
(1871, 'Bundle.properties', 'file.dataFilesTab.terms.list.termsOfUse.termsOfUse.title', 'Outlines how this data can be used once downloaded.', 'Descreve como esses dados podem ser usados depois de baixados.', '2019-08-07 12:57:17', 0),
(1872, 'Bundle.properties', 'file.dataFilesTab.terms.list.termsOfUse.termsOfUse.description', 'If you are unable to use CC0 for datasets you are able to set custom terms of use. Here is an example of a <a href="https://dataverse.org/best-practices/sample-dua" title="Sample Data Usage Agreement - Dataverse.org" target="_blank">Data Usage Agreement</a> for datasets that have de-identified human subject data.', 'Se você não conseguir usar CC0 para conjuntos de dados, poderá definir termos de uso personalizados. Veja um exemplo de um <a href="https://dataverse.org/best-practices/sample-dua" title="Contrato de uso de dados de amostra-Dataverse.org" target="_blank">Contrato de uso de dados</a> para conjuntos de dados que desidentificaram os dados do assunto humano.', '2019-08-07 12:57:17', 0),
(1873, 'Bundle.properties', 'file.dataFilesTab.terms.list.termsOfUse.addInfo', 'Additional Information', 'Informações Adicionais', '2019-08-07 12:57:17', 0),
(1874, 'Bundle.properties', 'file.dataFilesTab.terms.list.termsOfUse.addInfo.declaration', 'Confidentiality Declaration', 'Declaração de Confidencialidade', '2019-08-07 12:57:17', 0),
(1875, 'Bundle.properties', 'file.dataFilesTab.terms.list.termsOfUse.addInfo.declaration.title', 'Indicates whether signing of a confidentiality declaration is needed to access a resource.', 'Indica se a assinatura de uma declaração de confidencialidade é necessária para acessar um recurso.', '2019-08-07 12:57:17', 0),
(1876, 'Bundle.properties', 'file.dataFilesTab.terms.list.termsOfUse.addInfo.permissions', 'Special Permissions', 'Permissões especiais', '2019-08-07 12:57:17', 0),
(1877, 'Bundle.properties', 'file.dataFilesTab.terms.list.termsOfUse.addInfo.permissions.title', 'Determine if any special permissions are required to access a resource (e.g., if form is a needed and where to access the form).', 'Determine se são necessárias permissões especiais para acessar um recurso (por exemplo, se o formulário é necessário e onde acessar o formulário).', '2019-08-07 12:57:17', 0),
(1878, 'Bundle.properties', 'file.dataFilesTab.terms.list.termsOfUse.addInfo.restrictions', 'Restrictions', 'Restrições', '2019-08-07 12:57:17', 0),
(1879, 'Bundle.properties', 'file.dataFilesTab.terms.list.termsOfUse.addInfo.restrictions.title', 'Any restrictions on access to or use of the collection, such as privacy certification or distribution restrictions, should be indicated here. These can be restrictions applied by the author, producer, or disseminator of the data collection. If the data are restricted to only a certain class of user, specify which type.', 'Quaisquer restrições ao acesso ou uso da coleção, como a certificação de privacidade ou restrições de distribuição, devem ser indicadas aqui. Estas podem ser restrições aplicadas pelo autor, produtor ou disseminador da coleta de dados. Se os dados estiverem restritos a apenas uma determinada classe de usuários, especifique o tipo.', '2019-08-07 12:57:17', 0),
(1880, 'Bundle.properties', 'file.dataFilesTab.terms.list.termsOfUse.addInfo.citationRequirements', 'Citation Requirements', 'Requisitos de citação', '2019-08-07 12:57:17', 0),
(1881, 'Bundle.properties', 'file.dataFilesTab.terms.list.termsOfUse.addInfo.citationRequirements.title', 'Include special/explicit citation requirements for data to be cited properly in articles or other publications that are based on analysis of the data. For standard data citation requirements refer to our Community Norms.', 'Inclua requisitos de citação especiais/explícitos para que os dados sejam citados corretamente em artigos ou outras publicações baseadas na análise dos dados. Para requisitos de citação de dados padrão, consulte nossas Normas da Comunidade.', '2019-08-07 12:57:17', 0),
(1882, 'Bundle.properties', 'file.dataFilesTab.terms.list.termsOfUse.addInfo.depositorRequirements', 'Depositor Requirements', 'Requisitos do depositante', '2019-08-07 12:57:17', 0),
(1883, 'Bundle.properties', 'file.dataFilesTab.terms.list.termsOfUse.addInfo.depositorRequirements.title', 'Information regarding user responsibility for informing Dataset Depositors, Authors or Curators of their use of data through providing citations to the published work or providing copies of the manuscripts.', 'Informações sobre a responsabilidade do usuário de informar os Depositantes, Autores ou Curadores do Dataset sobre o uso de dados por meio de citações para o trabalho publicado ou do fornecimento de cópias dos manuscritos.', '2019-08-07 12:57:17', 0),
