(3148, 'customARCS.properties', 'datasetfieldtype.ARCS1.title', '1) Were any of these data sets a) purchased, b) obtained through licensed databases, or c) provided by an organization under a nondisclosure or other agreement?', '1) Algum desses conjuntos de dados a) foram adquiridos, b) obtidos por meio de bancos de dados licenciados, ou c) fornecidos por uma organização sob um sigilo ou outro contrato?', '2019-08-07 17:11:41', 0),
(3149, 'customARCS.properties', 'datasetfieldtype.ARCS2.title', '2) If you responded Yes to Q1, have you ensured that sharing the data does not violate terms of the agreement? If you responded No to Q1, please enter N/A here.', '2) Se você respondeu Sim ao Q1, você se assegurou de que o compartilhamento dos dados não viola os termos do contrato? Se você respondeu Não ao Q1, insira N/A aqui.', '2019-08-07 17:11:41', 0),
(3150, 'customARCS.properties', 'datasetfieldtype.ARCS3.title', '3) Do any of these data sets include individual-level data (either collected or pre-existing in the dataset) that might make them subject to U.S. or international human subjects considerations?', '3) Algum desses conjuntos de dados inclui dados em nível individual (coletados ou pré-existentes no conjunto de dados) que possam torná-los sujeitos a considerações de assuntos humanos nos EUA ou internacionais?', '2019-08-07 17:11:41', 0),
(3151, 'customARCS.properties', 'datasetfieldtype.ARCS4.title', '4) If you responded Yes to Q3, are these data sets totally de-identified or was sharing approved by your institutional review board ( IRB)? If you responded No to Q3 please enter N/A here.', '4) Se você respondeu Sim ao Q3, esses conjuntos de dados são totalmente desidentificados ou compartilhados aprovados pelo seu comitê de revisão institucional (IRB)? Se você respondeu Não ao Q3, insira N/A aqui.', '2019-08-07 17:11:41', 0),
(3152, 'customARCS.properties', 'datasetfieldtype.ARCS5.title', '5) Do these datasets contain sensitive or personally identifiable private information? (Harvard Research Data Security Policy {www.security.harvard.edu/research-data-security-policy} may apply because this Dataverse is hosted by Harvard University.)', '5) Esses conjuntos de dados contêm informações privadas confidenciais ou identificáveis pessoalmente? (A Política de segurança de dados da Harvard Research {www.security.harvard.edu/research-data-security-policy} pode ser aplicada porque esse Dataverse é hospedado pela Universidade de Harvard.)', '2019-08-07 17:11:41', 0),
