(3184, 'customCHIA.properties', 'datasetfieldtype.datesAdditionalInformationCHIA.description', 'Dates - Additional Information - Note any additional information about dates or time periods in the dataset including intervals (annual, decennial, centennial, etc.) Also note the column(s) in the dataset where dates and other temporal information can be found.', 'Datas - Informações Adicionais - Anote qualquer informação adicional sobre datas ou períodos de tempo no conjunto de dados incluindo intervalos (anual, decenal, centenário, etc.). Observe também a(s) coluna(s) no dataset onde datas e outras informações temporais podem ser encontrado.', '2019-08-07 17:14:23', 0),
(3185, 'customCHIA.properties', 'datasetfieldtype.variablesCHIA.description', 'Variables - Define the variables in this dataset. Please note the column in the dataset where variable information can be found.', 'Variáveis - Defina as variáveis neste conjunto de dados. Observe a coluna no conjunto de dados onde informações variáveis podem ser encontradas.', '2019-08-07 17:14:23', 0),
(3186, 'customCHIA.properties', 'datasetfieldtype.classificationSchemaCHIA.description', 'Classification Schema - If there is a classification scheme in this dataset, please describe it. For example, M_20_24 should be read as Males, aged 20-24.', 'Esquema de classificação - Se houver um esquema de classificação neste conjunto de dados, por favor, descreva-o. Por exemplo, M_20_24 deve ser lido como Machos, com idade entre 20 e 24 anos.', '2019-08-07 17:14:23', 0),
(3187, 'customCHIA.properties', 'datasetfieldtype.provenanceCHIA.description', 'Provenance - The provenance of the datasets is the record of ownership and will be used as a guide to the authenticity or quality of the data. For example, the Provenance statement might be, "This dataset was created from data collected by David Ruvolo during a data collection trip to Spain in 1992. Since that time, the data has not been altered other than to migrate it to more current formats."', 'Proveniência - A origem dos conjuntos de dados é o registro de propriedade e será usada como um guia para a autenticidade ou qualidade dos dados. Por exemplo, a declaração de Proveniência pode ser: "Este conjunto de dados foi criado a partir de dados coletados por David Ruvolo durante uma viagem de coleta de dados à Espanha em 1992. Desde então, os dados não foram alterados além de migrá-los para formatos mais atuais."', '2019-08-07 17:14:23', 0),
(3188, 'customCHIA.properties', 'datasetfieldtype.rightsAvailabilityCHIA.description', 'Rights/Availability - Do you have the rights to share this data?', 'Direitos/Disponibilidade - Você tem o direito de compartilhar esses dados?', '2019-08-07 17:14:23', 0),
