(4007, 'geospatial.properties', 'datasetfieldtype.geographicCoverage.description', 'Information on the geographic coverage of the data. Includes the total geographic scope of the data.', 'Informação sobre a cobertura geográfica dos dados. Inclui o escopo geográfico total dos dados.', '2019-08-07 17:21:43', 0),
(4008, 'geospatial.properties', 'datasetfieldtype.country.description', 'The country or nation that the Dataset is about.', 'O país ou nação do conjunto de dados.', '2019-08-07 17:21:43', 0),
(4009, 'geospatial.properties', 'datasetfieldtype.state.description', 'The state or province that the Dataset is about. Use GeoNames for correct spelling and avoid abbreviations.', 'O estado ou província sobre o qual o conjunto de dados é. Use GeoNames para corrigir a ortografia e evitar abreviaturas.', '2019-08-07 17:21:43', 0),
(4010, 'geospatial.properties', 'datasetfieldtype.city.description', 'The name of the city that the Dataset is about. Use GeoNames for correct spelling and avoid abbreviations.', 'O nome da cidade sobre a qual o conjunto de dados é. Use GeoNames para corrigir a ortografia e evitar abreviaturas.', '2019-08-07 17:21:43', 0),
(4011, 'geospatial.properties', 'datasetfieldtype.otherGeographicCoverage.description', 'Other information on the geographic coverage of the data.', 'Outras informações sobre a cobertura geográfica dos dados.', '2019-08-07 17:21:43', 0),
(4012, 'geospatial.properties', 'datasetfieldtype.geographicUnit.description', 'Lowest level of geographic aggregation covered by the Dataset, e.g., village, county, region.', 'Nível mais baixo de agregação geográfica coberto pelo conjunto de dados, por exemplo, vila, município, região.', '2019-08-07 17:21:43', 0),
(4013, 'geospatial.properties', 'datasetfieldtype.geographicBoundingBox.description', 'The fundamental geometric description for any Dataset that models geography is the geographic bounding box. It describes the minimum box, defined by west and east longitudes and north and south latitudes, which includes the largest geographic extent of the  Dataset´s geographic coverage. This element is used in the first pass of a coordinate-based search. Inclusion of this element in the codebook is recommended, but is required if the bound polygon box is included.', 'A descrição geométrica fundamental de qualquer conjunto de dados que modela a geografia é a caixa delimitadora geográfica. Descreve a caixa mínima, definida pelas longitudes oeste e leste e latitudes norte e sul, que inclui a maior extensão geográfica da cobertura geográfica do Dataset. Esse elemento é usado na primeira passagem de uma pesquisa baseada em coordenadas. A inclusão deste elemento no codebook é recomendada, mas é necessária se a caixa do polígono encadernado estiver incluída.', '2019-08-07 17:21:43', 0),
(4014, 'geospatial.properties', 'datasetfieldtype.westLongitude.description', 'Westernmost coordinate delimiting the geographic extent of the Dataset. A valid range of values,  expressed in decimal degrees, is -180,0 <= West  Bounding Longitude Value <= 180,0.', 'Coordenada mais ocidental que delimita a extensão geográfica do conjunto de dados. Um intervalo válido de valores, expresso em graus decimais, é: -180,0 <= Valor Limite de Longitude Oeste <= 180,0.', '2019-08-07 17:21:44', 0),
(4015, 'geospatial.properties', 'datasetfieldtype.eastLongitude.description', 'Easternmost coordinate delimiting the geographic extent of the Dataset. A valid range of values,  expressed in decimal degrees, is -180,0 <= East Bounding Longitude Value <= 180,0.', 'Coordenada mais oriental que delimita a extensão geográfica do conjunto de dados. Um intervalo válido de valores, expresso em graus decimais, é: -180,0 <= Valor Limite de Longitude Leste <= 180,0.', '2019-08-07 17:21:44', 0),
(4016, 'geospatial.properties', 'datasetfieldtype.northLongitude.description', 'Northernmost coordinate delimiting the geographic extent of the Dataset. A valid range of values,  expressed in decimal degrees, is -90,0 <= North Bounding Latitude Value <= 90,0.', 'Coordenada mais setentrional que delimita a extensão geográfica do conjunto de dados. Um intervalo válido de valores, expresso em graus decimais, é: -90,0 <= Valor Limite de Latitude Norte <= 90,0.', '2019-08-07 17:21:44', 0),
(4017, 'geospatial.properties', 'datasetfieldtype.southLongitude.description', 'Southernmost coordinate delimiting the geographic extent of the Dataset. A valid range of values,  expressed in decimal degrees, is -90,0 <= South Bounding Latitude Value <= 90,0.', 'Coordenada mais meridional que delimita a extensão geográfica do conjunto de dados. Um intervalo válido de valores, expresso em graus decimais, é: -90,0 <= Valor Limite de Latitude Sul <= 90,0.', '2019-08-07 17:21:44', 0),
