(6645, 'Bundle.properties', 'dataset.message.editTerms', 'Modifica le condizioni del dataset – Aggiorna le condizioni d’uso di questo dataset', 'Modifique as condições do conjunto de dados - Atualize as condições de uso deste conjunto de dados', '2019-09-25 13:59:47', 0),
(6644, 'Bundle.properties', 'dataset.message.editMetadata', 'Modifica i metadati del dataset - Aggiungi altri metadati a questo dataset per aiutare gli altri a trovarlo facilmente.', 'Modifique os metadados do conjunto de dados - Adicione outros metadados a esse conjunto de dados para ajudar outras pessoas a encontrá-lo facilmente.', '2019-09-25 13:59:47', 0),
(6643, 'Bundle.properties', 'dataset.message.uploadFiles', 'Carica i file del dataset – Puoi trascinare e rilasciare i file dal desktop, direttamente nel widget di caricamento.', 'Carregar arquivos do conjunto de dados - Você pode arrastar e soltar arquivos da área de trabalho diretamente no widget de upload.', '2019-09-25 13:59:47', 0),
